let img;
let font;

let logo = 0;
let logoCooldown = 0;
let fetchCooldown = 0;
let usdApi = "https://api.binance.com/api/v3/ticker/24hr?symbol=DGBUSDT";
let btcApi = "https://api.binance.com/api/v3/ticker/24hr?symbol=DGBBTC";
let usd;
let btc;

function usdCallback(data) {
  usd = data;
}
function btcCallback(data) {
  btc = data;
}
function usdECallback(data) {
  usd = {
    lastPrice: "t.me/RenzoDD"
  };
}
function btcECallback(data) {
  btc =  {
    lastPrice: "t.me/RenzoDD"
  };
}

function preload() {
  img = {
    logos: [
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,")
    ],
    digiasset: [
      loadImage("data:image/png;base64,")
    ]
  }
  font = [
    loadFont("data:@file/x-font-ttf;base64,")
  ]
  //usd = loadJSON(usdApi);
  //btc = loadJSON(btcApi);
}
function setup() {
  createCanvas(300, 150);
  textFont(font[0]);
  textAlign(CENTER)
  fill("#FFFFFF")
  usd =  {
    lastPrice: "Price in"
  };
    btc =  {
    lastPrice: "Price in"
  };
}

function draw() {
  background("#002352");
  image(img.logos[logo], 20, 30, 90, 90);
  image(img.digiasset[0], 270, 120, 25, 25);
  
  textSize(25)
  fill('#FFFFFF');
  text("DigiByte\nPrice Monitor", 190, 40);
  
  textSize(20)
  

  if (float(usd.lastPrice) < float(usd.prevClosePrice))
    fill('#F6465D');
  else if (float(usd.lastPrice) > float(usd.prevClosePrice))
    fill('#0ECB81')
  else
    fill('#707A8A');
  
  
  text(usd.lastPrice + " USD", 190, 110)
  
  
  
  if (float(btc.lastPrice) < float(btc.prevClosePrice))
    fill('#F6465D');
  else if (float(btc.lastPrice) > float(btc.prevClosePrice))
    fill('#0ECB81')
  else
    fill('#707A8A');
  
  text(btc.lastPrice + " BTC", 190, 135)
  
  if (millis() - logoCooldown >= 5000)
  {
    logoCooldown = millis();
    logo = (logo + 1) % 3
  }
  
  if (millis() - fetchCooldown >= 1000)
  {
    fetchCooldown = millis();
    loadJSON(usdApi, usdCallback, usdECallback);
    loadJSON(btcApi, btcCallback, usdECallback);

  }
}